/**
 * 获取背景图
 * w 宽度
 * h 高度
 * imgSrc 图片地址
 * */
function getImg(w, h, imgSrc) {
    //创建临时图片，创建设定长宽的画布，将图片画到画布上，转换为新图片输出
    let tmpImg = new Image();
    //创建画布
    let canvas = document.createElement('canvas');
    //获取画布上下文
    let ctx = canvas.getContext('2d');
    //设置画布宽、高
    canvas.width = w;
    canvas.height = h;
    //设置图片加载完毕后绘图
    tmpImg.onload = function() {
        ctx.drawImage(tmpImg, 0, 0, canvas.width, canvas.height);
    };
    //加载图片
    tmpImg.src = imgSrc;
    return canvas;
}
